INSERT INTO `products` (`id`, `category_id`, `name`, `name_en`, `description`, `description_en`, `images`, `images_min`, `min_price`, `min_price_en`, `max_price`, `max_price_en`, `average_price`, `average_price_en`, `quantity`, `created_at`, `changed_at`) VALUES
(1, 7, 'Fanatica ', 'Fanatica ', '<p>Ручка для работы модульными системами. Не для кого не секрет, что модульная система гасит хлёсткость любого модульного аппарата, из-за мембраны картриджа , а также за счёт встроенной в аппарат обратно-поступательной пружины . В машинке фанатика , мы смогли добиться максимальной имитации работы системы игла-дюза, за счёт того, что не стали ставить пружину, для сохранения силы удара , внутреннюю конструкцию шатуна установлена на двух подшипниках, что даёт максимально легкое скольжение, и конечно же ,мотор премиум класса maxon DC max ,который также стоит на нашем флагмане Lovi.</p><p>Вес аппарата 70 гр.</p><p>В комплекте :</p><p>-машинка</p><p>-провод питания RCA</p><p>Цена 42 т . рублей</p><p>Гарантия 6 м есяцев</p>', '<p>Fanatica </p>', '[\"public\\/images\\/products\\/Fanatica  6421a38858802.jpg\"]', '[\"public\\/images\\/products\\/min\\/Fanatica  6421a38858859.jpg\"]', 42000, 520, 42000, 520, 42000, 520, 3, '2023-03-27 16:48:48', '2023-04-25 22:08:03'),
(2, 5, 'GURU АКЦИЯ - 50%', 'GURU ', '<p>Идеально подойдёт как для новичка так и для опытного мастера. Благодаря своей универсальности, каждый мастер найдёт свою любимую настройку для каждой зоны. На аппарате стоит базовый эксцентрик с ходом 3,5 мм , мы рекомендуем эту длинну хода для работы на системе игла-дюза (через переходник tattoohelper), при такой настройке аппарата получается красивый мягкий пиксель. Если поставить эксцентрик с ходом 2,5 мм и переходник под модуль , тогда получается быстрый, плотный и мягкий прокрас . Также вы можете ставить тату иглу, на любой эксцентрик ( 3,5 или 2мм) и получать не менее красивые работы.</p><p>В машинке стоит мотор фулхабер (оригинал ).Вес 52 гр</p><p>В комплекте идет машинка GURU, базовый эксцентрик с ходом 3,5 , шнур питания и переходник на выбор. </p>', '<p>Guru</p>', '[\"public\\/images\\/products\\/GURU  64219f7b77c03.jpg\"]', '[\"public\\/images\\/products\\/min\\/GURU  64219f7b77c9c.jpg\"]', 17000, 300, 17000, 300, 17000, 300, 3, '2023-03-27 16:51:55', '2023-06-05 19:09:05'),
(3, 6, 'Lovi ', 'Lovi', '<p>Легендарный аппарат, который навсегда покорил сотни мастеров самыми красивыми пикселями, аппарат который принёс множество кубков за самый воздушные брови в чемпионатах. Да! Не один аппарат не даёт такой красивый пиксель как Лови! Благодаря наличию 3 насадок жёсткости , вы можете настроить машинку под любой тип кожи и желаемый уровень прокраса.</p><p>Аппарат предназначен для работы на игле-дюзе , через переходник tattoohelper. Ход иглы 3,8 мм. Вес 65 гр.</p><p>Мотор MAXON (оригинал)</p><p>В комплекте машинка, шнур питания, tattoohelper</p>', '<p>Lovi </p>', '[\"public\\/images\\/products\\/Lovi 6421a6dc6a8b4.jpg\"]', '[\"public\\/images\\/products\\/min\\/Lovi 6421a6dc6a90c.jpg\"]', 42000, 530, 42000, 530, 42000, 530, 2, '2023-03-27 17:23:24', '2023-05-12 09:10:07'),
(4, 8, 'X-PRO ПРЕДЗАКАЗ!', 'X-PRO', '<p class=\"ql-align-justify\"><strong>После оплаты,  время ожидания аппарата 2 недели. </strong></p><p class=\"ql-align-justify\">Характеристики X-PRO</p><p class=\"ql-align-justify\">&nbsp;▪️Вес- 75</p><p class=\"ql-align-justify\">▪️Длинна- 90 мм </p><p class=\"ql-align-justify\">▪️ Ход -3,5 мм</p><p class=\"ql-align-justify\">▪️Бесколлекторный мотор (надёжный, мощный и тяговитый) на котором вы можете не бояться ставить картриджи с абсолютно любой мембраной жёсткости.</p><p class=\"ql-align-justify\">▪️рабочий вольтаж 4-8 вольт</p><p class=\"ql-align-justify\">В этом аппарате мы учли запросы мастеров разных уровней , работающих в самых разных техниках и&nbsp;воплотили всё в одном аппарате.&nbsp;</p><p class=\"ql-align-justify\">X-PRO&nbsp;- это самый универсальный аппарат на рынке сегодня.&nbsp;&nbsp;Вы получаете 6 машинок в одном аппарате( короткоход, гибрид и длинноход на дюзе и короткоход, гибрид и длинноход на модулях)</p><p class=\"ql-align-justify\"><span style=\"color: var(--bs-body-color);\">В комплекте идёт 2 держателя:</span></p><p class=\"ql-align-justify\">-один для работы на картридже ;</p><p class=\"ql-align-justify\">-второй для работы на системе игла-дюза( для стерилизации вы можете докупить запасные держатели и толкатели) .&nbsp;</p><p class=\"ql-align-justify\">Также в комплекте идёт 2 дополнительных эксцентрика :</p><ul><li class=\"ql-align-justify\">3,8 мм ( длинноход)</li><li class=\"ql-align-justify\">2,8мм ( короткоход)</li></ul>', '<p>Характеристики X-PRO</p><p><span style=\"color: var(--bs-body-color); font-weight: var(--bs-body-font-weight);\"> ▪️Вес- 75</span></p><p>▪️Длинна- 90 мм </p><p>▪️ Ход -3,5 мм</p><p>▪️Бесколлекторный мотор (надёжный, мощный и тяговитый) на котором вы можете не бояться ставить картриджи с абсолютно любой мембраной жёсткости.</p><p>▪️рабочий вольтаж 4-8 вольт</p><p>В этом аппарате мы учли запросы мастеров разных уровней , работающих в самых разных техниках и воплотили всё в одном аппарате. </p><p>X-PRO -это самый универсальный аппарат на рынке сегодня.  Вы получаете 6 машинок в одном аппарате( короткоход, гибрид и длинноход на дюзе и короткоход, гибрид и длинноход на модулях)</p><p>В комплекте идёт 2 держателя:</p><p>-один для работы на картридже ;</p><p>-второй для работы на системе игла-дюза( для стерилизации вы можете докупить запасные держатели и толкатели) . </p><p>Также в комплекте идёт 2 дополнительных эксцентрика :</p><ul><li>3,8 мм ( длинноход)</li><li>2,8мм ( короткоход)</li></ul>', '[\"public\\/images\\/products\\/X-PRO black  645cf30b19ac6.jpg\"]', '[\"public\\/images\\/products\\/min\\/X-PRO black  645cf30b19b37.jpg\"]', 50000, 0, 50000, 0, 50000, 0, 2, '2023-03-27 17:30:08', '2023-06-08 19:07:25'),
(5, 4, 'Tattoohelper титан ф18', 'Tattoohelper ', '<p>Переходник для роторных машинок. Позволяет работать на системе игла - дюза.</p><p>В комплекте: Переходник диаметр ф18</p><p>фторопластовая вставка</p><p>бар-иглодержатель</p><p>шестигранный ключ</p>', '<p>Tattoohelper </p>', '[\"public\\/images\\/products\\/Tattoohelper  6421fd2269699.jpg\",\"public\\/images\\/products\\/Tattoohelper  6421fd226969c.jpg\"]', '[\"public\\/images\\/products\\/min\\/Tattoohelper  6421fd2269761.jpg\"]', 5000, 70, 5000, 70, 5000, 70, 0, '2023-03-27 23:31:30', '2023-03-30 17:01:42'),
(6, 4, 'Tattoohelper титан ф16', 'Tattoohelper ', '<p>Переходник для роторных машинок. Позволяет работать на системе игла - дюза.</p><p>В комплекте: Переходник диаметр ф16</p><p>фторопластовая вставка</p><p><span style=\"color: var(--bs-body-color); font-weight: var(--bs-body-font-weight);\">бар-иглодержатель</span></p><p><span style=\"color: var(--bs-body-color);\">шестигранный ключ</span></p>', '<p>Tattoohelper </p>', '[\"public\\/images\\/products\\/Tattoohelper  6421fd5d05520.jpg\",\"public\\/images\\/products\\/Tattoohelper  6421fd5d05523.jpg\"]', '[\"public\\/images\\/products\\/min\\/Tattoohelper  6421fd5d055e6.jpg\"]', 5000, 70, 5000, 70, 5000, 70, 10, '2023-03-27 23:32:29', '2023-05-12 09:10:35'),
(7, 4, 'Держатель под картридж ', 'Grip for cartridges ', '<p>Переходник для роторных тату машинок, позволяет работать картриджем (модулем).</p><p>В комплект входит: толкатели 2 шт. 9.2 см.</p><p>Характеристики:</p><p>Диаметр узкой части держателя 16 мм, а широкой части 19 мм.</p><p>Цвет: серебро</p><p>Материал: титан</p><p>Вес: 45 гр.</p>', '<p>Cartridg</p>', '[\"public\\/images\\/products\\/Grip for cartridges  64221668eb0a9.jpg\"]', '[\"public\\/images\\/products\\/min\\/Grip for cartridges  64221668eb109.jpg\"]', 5500, 70, 5500, 70, 5500, 70, 10, '2023-03-28 01:16:43', '2023-05-12 09:10:57'),
(8, 3, 'Шнур RCA ', 'RCA ', '<p>Шнур RCA </p>', '<p>RCA </p>', '[\"public\\/images\\/products\\/RCA  6422b1010b267.jpg\"]', '[\"public\\/images\\/products\\/min\\/RCA  6422b1010b2bf.jpg\"]', 2000, 30, 2000, 30, 2000, 30, 20, '2023-03-28 12:18:57', '2023-04-26 12:42:48'),
(9, 3, 'Шнур питания для Lovi, Guru, Ray', 'Lovi, Guru, Ray ', '<p>Шнур питания для аппаратов Lovi, Guru, Ray </p>', '<p>Lovi, Guru, Ray </p>', '[\"public\\/images\\/products\\/Lovi, Guru, Ray  6422b1c1bf172.jpg\"]', '[\"public\\/images\\/products\\/min\\/Lovi, Guru, Ray  6422b1c1bf1c7.jpg\"]', 2000, 30, 2000, 30, 2000, 30, 25, '2023-03-28 12:22:09', '2023-04-26 12:43:26'),
(10, 8, 'Хорс мрамор ', 'Xopc mramor', '<p>Наша компания производит лучшее оборудование для перманентного макияжа. Мы знаем как должен работать аппарат , чтобы обеспечить максимальный результат проведённой процедуры. Хорс - это сочетание современных технологий, нашего опыта и знаний. Мы учли все возможные потребности мастера и воплотили их в этом аппарате:</p><p>- идеальные габариты и вес;</p><p>- отсутствие вибрации ;</p><p>- правильное соотношение мощности мотора к скорости;</p><p>- работа с картриджами любой жёсткости;</p><p>- одинаково идеально держит линию и красит</p>', '<p>Xopc</p>', '[\"public\\/images\\/products\\/Xopc mramor 64429889cfcfd.jpg\"]', '[\"public\\/images\\/products\\/min\\/Xopc mramor 64429889cfdfe.jpg\"]', 39000, 500, 39000, 500, 39000, 500, 1, '2023-03-30 16:55:59', '2023-04-30 21:02:18'),
(11, 2, 'Эксцентрик сменный Fanatica ход 2 мм', 'Fanatica stroke 2mm', '<p>Сменный эксцентрик на аппарат FANATICA. Ход 2 мм </p>', '<p>Fanatica stroke 2 mm</p>', '[\"public\\/images\\/products\\/Fanatica stroke 2mm 6425d7072734e.jpg\"]', '[\"public\\/images\\/products\\/min\\/Fanatica stroke 2mm 6425d707273a6.jpg\"]', 2500, 40, 2500, 40, 2500, 40, 2, '2023-03-30 21:37:59', '2023-03-30 21:37:59'),
(12, 2, 'Толкатель бар ( для картриджей) ', 'Bar', '<p>Толкатель бар для картриджной  системы</p>', '<p>Bar</p>', '[\"public\\/images\\/products\\/Bar 6425d77d3a021.jpg\"]', '[\"public\\/images\\/products\\/min\\/Bar 6425d77d3a06e.jpg\"]', 150, 3, 150, 3, 150, 3, 3, '2023-03-30 21:39:57', '2023-03-30 21:39:57'),
(13, 2, 'Бар (иглодержатель) для игла / дюза ', 'Bar needle', '<p>Бар (иглодержатель) для системы игла дюза</p>', '<p>Bar needle</p>', '[\"public\\/images\\/products\\/Bar needle 6441200755f00.jpg\"]', '[\"public\\/images\\/products\\/min\\/Bar needle 6441200755fc9.jpg\"]', 1300, 20, 1300, 20, 1300, 20, 10, '2023-04-20 14:20:39', '2023-04-20 14:20:39'),
