(4334, NULL, 'CharlesdugVE', 'Charlesdug', 'RU', 'AZ', 'RU', '82974258796', 'ilianaglebova@yandex.kz', '', 'https://trustorg.top', '', 'Paphos', 'Paphos', '122543', 'Космический спутник NASA, наблюдавший за вспышками на солнце и помог физикам понять мощные выбросы солнечной энергии, обрушился на этой неделе, спустя долгие годы со дня его запуска. \r\nВышедший на пенсию космический аппарат Reuven Ramaty High Energy Solar Spectroscopic Imager (RHESSI), запущенный в 2002 году и выведенный из эксплуатации в 2018 г., снова влетел в земную атмосферу 19 апреля примерно в в 8 вечера, по данным НАСА. \r\nКак говорит Мин обороны Америки, космолет 300 кг снова вошел в атмосферу над районом пустыни Сахара на координатах 26 д и 21.3 ш. \r\nNASA думало, что большая часть космического корабля сточится в атмосфере во время падения, но некоторые компоненты могли пережить вход в атмосферу. \r\n«В настоящее время НАСА не получало никаких сообщений о каком-либо ущербе или вреде, из-за прохождения атмосферы», — заявляет агентство NASA. \r\nКосмический увеличитель Webb запечатлел вспышку звездообразования во время столкновения галактик. \r\nКосмолет был оборудован специальным прибором, который регистрировал рентгеновское и гамма-излучение Солнца. По словам НАСА, со своей старой позиции на низкой околоземной орбите спутник сделал снимки высокоэнергетических электронов, которые несут много энергии, выделяемой при солнечных вспышках. \r\nТакие явления выделяют энергию, сравнимую с млрд. тонн тротила, в солнечную атмосферу всего за несколько минут и могут иметь последствия для Земли, включая нарушение работы электрических систем. \r\nЗа прошедшие годы RHESSI обнаружил огромный размах вспышек на Солнце, от мелких микровспышек до гигантских вспышек, которые были в десятки тысяч раз больше и взрывоопаснее. \r\nДанные с ресурса [url=https://trustorg.top/dostavka.html]trustorg.top[/url]', 'b7eb60d4beb43ed6b5a04337263662d0', 'authorize', 0, 0, '2023-04-25 01:19:06', '2023-04-27 01:21:06'),
