(6059, NULL, 'BrettnafSG', 'Brettnaf', 'RU', 'GE', 'RU', '87415537256', 'mariannasvetlanina@yandex.ru', '', 'https://polimodalpsy.ru/training', '', 'Russia', 'Russia', '133542', 'Врачу вовсе не обязательно верить в медицину — больной верит в нее ради двоих. \r\n \r\nСостояние больного напрямую зависит от состояния. (контрапунктист: Ефим Шпигель) \r\n \r\nВрачи с нами, как дети с игрушками — им интересно что у нас изнутри. (напевщик высказывания: Илья Герчиков) \r\n \r\nВоспроизвести Некоторые примеры битональности накладывают полностью гармонизированные музыкальные фрагменты в разных тональностях. \r\n \r\nПолимодальная психология связывает вместе: урочный час, деньги, систему ценностей, мысли, направления развития, законы мироздания, общение с Богом, функционирование организма, мировоззрение, мироощущение, энергию, пространство, ситуация физического тела. \r\n \r\n \r\nПоловина из них нуждаются в срочной консультации, напоминающей скорее психореанимацию. \r\n \r\nЯ тяжело болел, но вопреки стараниям врачей — выжил. (контрапунктист: Берн Эрик) \r\n \r\nПолимодальная психотерапия отменяет мономодальную психотерапию: дипломированных университетских психологов, говорящие головы из телевизора, специалистов по дизайну человека, верующих во Фрейда, Юнга. \r\n \r\nМежду бесплатной вдобавок платной медициной нездоровая конкуренция. (сочинитель высказывания: Леонид Крайнов—Рытов) \r\n \r\nРано или поздно клиент выздоровел быстрее, на смену мы его собирались вылечить — это бегство в здоровье. (автор: Тимур Гагин) \r\n \r\nДейственность медицины ослабляется неверием вдобавок укрепляется надеждою. (контрапунктист: П. Буаст) \r\n \r\nПрограммы Института – это современный полимодальный подход, ориентированный на практику. Особое процент мы уделяем сочетанию персональных особенностей обучающегося в свой черед профессиональных требований в сфере его деятельности. \r\n \r\nРано или поздно помогло, природа восхваляется, От случая к случаю нет врач обвиняется. (контрапунктист: неизвестный) \r\n \r\nПрежде магию путали с медициной; ныне медицину путают с магией. (сочинитель: Томас Сас)', '11f3b1e448b25e43a27332746e0387e8', 'authorize', 0, 0, '2023-05-03 20:24:25', '2023-05-05 21:00:27'),
