(6819, NULL, 'LeonardBotJS', 'LeonardBot', 'RU', 'BI', 'RU', '81263349652', 'qzhenjaa@yandex.kz', '', 'https://bigrush.top', '', 'Lilongwe', 'Lilongwe', '124332', 'В последние годы 3D-печать служила для производства всего, от зданий до производств и даже мостов. Теперь Дубай планирует произвести первую в мире мечеть, сделанную с помощью 3D принтера. \r\nПо словам главного инженера Департамента по делам ислама и благотворительной деятельности правительства Дубая, конструкция сможет принять 600 верующих и будет занимать 2000 кв.м. на двух этажах. Изготовлен будет он из смеси бетона, выполнение планируется запустить в конце года и закончить в первом квартале 2025 года. \r\nIACAD не стал называть организацию, отвечающую за печать. \r\nДля возведений конструкций при помощи 3D-принтера требуются огромные печатные машины, на которые запрограммирована проектная информация. Выделяют бетон из специального сопла, наращивая конструкцию слоями. Подавляющее большинство конструкций, выполненых на 3D-принтере, сделаны из бетона, но возможно производство и из других материалов, например глина. \r\nДубай планировал стать мировой столицей 3D-печати, и в 2018 году он запустил стратегию, по которой к 2030 году 25% нового строительства эмирата будет выполнено при помощи 3D-печати. \r\nВ 2019 году он провозгласился рекордсменом мира по самой большой структуре, созданой с помощью 3D-печати, — зданию муниципалитета Дубая (высотой 9,5 метра и площадь 640 кв. м.), а также здесь находился первый в мире офис, напечатанный на 3D-принтере, и НИИ дронов, созданная при помощи 3D-печати. \r\nНо новые здания, произведенные 3D-печатью, уже появляются везде. Парки и целые кварталы, как, например, проект New Story в Табаско, который предоставит дома семьям, живущим в бедности. \r\nКомпания 3D-печати готовится строить на Луне. Она сторонник модернизации сферы стройки при помощи таких новинок, 3D-строительство. \r\nИсточник данных [url=https://bigrush.top/product.php?id_product=22]bigrush.top[/url]', 'cbb4851dd6b84651ecbe377bbf77826f', 'authorize', 0, 0, '2023-05-08 03:40:11', '2023-05-10 03:50:26'),
